export function separateEmails(text) {
	const emails = text.split('Email');
	return emails.map(email => email.trim()).filter(email => email !== '');
  }
  
export function clickButtonOnEnter(buttonId) {
	document.addEventListener('keyup', event => {
	  if (event.key === 'Enter') {
		document.getElementById(buttonId).click();
	  }
	});
  }  

export function appendParamToUrl(paramName, paramValue) {
    var newUrl = new URL(window.location.href);
    var params = new URLSearchParams(newUrl.search);
    params.append(paramName, paramValue);
    newUrl.search = params.toString();
    window.history.pushState({}, "", newUrl);
}

export function randomWord() {
    const letters = "abcdefghijklmnopqrstuvwxyz";
    let word = "";
    for (let i = 0; i < 6; i++) {
        word += letters[Math.floor(Math.random() * letters.length)];
    }
    return `baruaAI-${word}`;
}

export function removeDuplicateObjects(arr) {
	var uniqueObjects = arr.filter(function(obj, index, self) {
	  return self.map(function(e) { return e.email; }).indexOf(obj.email) === index;
	});
	return uniqueObjects;
  }

export function removeSellingPhrase(str) {
    return str.replace("I am selling", "");
}

export function removeNumbers(str) {
    return str.replace(/[0-9:]/g, '');
}

export function setSignedInUserCookie(value) {
	document.cookie = "signedInUser=" + value + ";path=/";
  }
  
export function getSignedInUserCookie() {
    var name = "signedInUser=";
    var decodedCookie = decodeURIComponent(document.cookie);
    var ca = decodedCookie.split(';');
    for(var i = 0; i <ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) === ' ') {
            c = c.substring(1);
        }
        if (c.indexOf(name) === 0) {
            return c.substring(name.length, c.length);
        }
    }
    return "";
}

export function generateAccountNumber() {
	// Generate a random number with 8 digits
	var randomNumber = Math.floor(Math.random() * 100000000);
	// Add leading zeros to make sure the number has 8 digits
	var formattedNumber = ("00000000" + randomNumber).slice(-8);
	// Insert the dash in the middle of the number
	var accountNumber = formattedNumber.slice(0, 4) + "-" + formattedNumber.slice(4);
	return accountNumber;
  }
  
